import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText,
} from "reactstrap";
import { Link } from "react-router-dom";
import {connect} from 'react-redux'

const NavbarComp = ({isAuth}) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  const publicLinks=(
    <Nav navbar>
    <NavItem>
      <Link to="/mystadiums">
        {" "}
        <NavLink Style={{ color: "white" }}>my stadiums</NavLink>
      </Link>
    </NavItem>
    <NavItem>
      <Link to="/register">
        {" "}
        <NavLink Style={{ color: "white" }}>Register</NavLink>
      </Link>
    </NavItem>
    <NavItem>
      <Link to="/login">
        {" "}
        <NavLink Style={{ color: "white" }}>Login</NavLink>
      </Link>
    </NavItem>
  </Nav>
  )

  const privateLinks=(
    <Nav navbar>
    <NavItem>
      <Link to="/mystadiums">
        {" "}
        <NavLink Style={{ color: "white" }}>my stadiums</NavLink>
      </Link>
    </NavItem>
    <NavItem>
      <Link to="/mybooking">
        {" "}
        <NavLink Style={{ color: "white" }}>my Booking</NavLink>
      </Link>
    </NavItem>
    <NavItem>
      <Link to="/">
        {" "}
        <NavLink Style={{ color: "white" }}>Logout</NavLink>
      </Link>
    </NavItem>
  </Nav>
  )
  return (
    <div>
      <Navbar color="success  " dark expand="md">
        <NavbarBrand href="/">Stadiumbook</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar className="justify-content-end">
          {}
        </Collapse>
      </Navbar>
    </div>
  );
};

const mapStateToProps=(state)=>({
  isAuth:state.authReducer.isAuth
})

export default connect(mapStateToProps,{logout})(NavbarComp);
